import Home from '../pages/Home/index'
import Login from '../pages/Login/index'
import LayOut from '../LayOut/index'


let routes=[
    {
      path:'/',
      element:<LayOut></LayOut>,
      children:[
        {
            path:'/home',
            element:<Login></Login>,
        }
      ]
    },
    {
        path:'/login',
        element:<Login></Login>,
    },
    {
        path:'*',
        element:<div>404</div>
    }
]

export default routes
